def parse_log_entry(log_entry: str) -> dict:
    pattern = '^(?P<remote_host>\\S+) - (?P<user_name>\\S+) \\[(?P<timestamp>.*?)\\] "(?P<request_method>\\S+) (?P<request_url>\\S+) (?P<request_protocol>.*?)" (?P<response_status_code>\\d+) (?P<response_size>\\S+)$'
    match = re.match(pattern, log_entry)
